import React from 'react';

export default function Feadback({ onGood, onNeutral, onBad }) {
  return (
    <div>
      <h1>Please leave headback</h1>
      <button type="button" onClick={onGood}>
        Good
      </button>
      <button type="button" onClick={onNeutral}>
        Neutral
      </button>
      <button type="button" onClick={onBad}>
        Bad
      </button>
    </div>
  );
}
